    data: |
      SELECT DISTINCT + tab2.col2 / - col0 + - col0 * tab2.col0 * ( + col2 * col2 ) + 27 AS col2 FROM tab2 (FORMAT parquet);
  - name: tab2

outputs:
  - name: q8903.out
    data: |
      -35697
      -4112757
      -9011977
